%[text] ## Integrating Charts with App Designer
%[text] As of MATLAB R2021a, charts developed using the `ComponentContainer` superclass can be [integrated with App Designer](<matlab: web("https://www.mathworks.com/help/matlab/ref/appdesigner.customcomponent.configuremetadata.html")>) (Figure 7). With App Designer you can share charts with end users by creating metadata. The installed chart will then appear in the user's App Designer Component Library, where it can be used interactively in the canvas like any other component.
%[text] ![](text:image:790c)
%[text] Figure 7. Custom chart integrated with App Designer.
%%
%[text] ## Summary
%[text] In this article, we described design patterns and best practices for the implementation of custom charts, using the `ScatterFitChart` as an example. Many common visualization tasks, especially those that require dynamic graphics, can be performed using an appropriate chart. Designing and creating a chart requires up-front development time and effort, but charts can substantially simplify many visualization workflows.
